import math

def getDivisors(n):
    i = 2
    arr = []
    while i <= math.sqrt(n):
        if n % i == 0:
            if n / i == i:
                arr.append(i)
            else:
                arr.append(i)
                arr.append(n / i)
        i += 1
    return arr

def find_possible_N(A, M):
    ans = []
    counter = 0
    fac = getDivisors(M)
    for f in fac:
        if (f - 1) % A == 0 and f != 1:
            q = (f - 1) // A
            d = M // f
            N = q * d
            ans.append(int(N))
            counter += 1
    ans.sort()
    return (counter, ans)

